import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

function Header() {
  return (
    <Navbar expand="lg" variant="dark" bg="dark" fixed="bottom" >
      <Container>
        <Navbar.Brand href="#">PetShop</Navbar.Brand>
      </Container>
    </Navbar>
  );
}

export default Header;
